import React from 'react';
import { FileText, Globe, TrendingUp, ExternalLink } from 'lucide-react';

const SourcesDisplay = ({ sources }) => {
  if (!sources || Object.values(sources).every(arr => arr.length === 0)) {
    return null;
  }

  return (
    <div className="mt-6">
      <h3 className="text-lg font-semibold mb-4 flex items-center">
        <FileText className="mr-2 h-5 w-5" />
        📚 Sources Used
      </h3>

      {/* PDF Sources */}
      {sources.pdfs && sources.pdfs.length > 0 && (
        <div className="mb-4">
          <h4 className="font-medium mb-2 flex items-center">
            <FileText className="mr-2 h-4 w-4" />
            📄 PDF Documents
          </h4>
          {sources.pdfs.map((pdf, index) => (
            <div key={index} className="border border-gray-200 rounded-lg p-3 mb-2 bg-gray-50">
              <div className="font-medium">📄 {pdf}</div>
              <div className="text-sm text-gray-600">Internal document</div>
            </div>
          ))}
        </div>
      )}

      {/* Web Search Results */}
      {sources.web && sources.web.length > 0 && (
        <div className="mb-4">
          <h4 className="font-medium mb-2 flex items-center">
            <Globe className="mr-2 h-4 w-4" />
            🌐 Web Sources
          </h4>
          {sources.web.map((webResult, index) => (
            <div key={index} className="border border-gray-200 rounded-lg p-3 mb-2 bg-gray-50">
              <div className="font-medium flex items-center">
                <Globe className="mr-2 h-4 w-4" />
                {webResult.title}
              </div>
              <a 
                href={webResult.url} 
                target="_blank" 
                rel="noopener noreferrer"
                className="text-blue-600 hover:text-blue-800 text-sm flex items-center mt-1"
              >
                <ExternalLink className="mr-1 h-3 w-3" />
                🔗 Visit Site
              </a>
            </div>
          ))}
        </div>
      )}

      {/* News Sources */}
      {sources.news && sources.news.length > 0 && (
        <div className="mb-4">
          <h4 className="font-medium mb-2 flex items-center">
            <Globe className="mr-2 h-4 w-4" />
            📰 News Articles
          </h4>
          {sources.news.map((article, index) => (
            <div key={index} className="border border-gray-200 rounded-lg p-3 mb-2 bg-gray-50">
              <div className="font-medium">📰 {article.title}</div>
              <div className="text-sm text-gray-600 mb-1">Source: {article.source}</div>
              <a 
                href={article.url} 
                target="_blank" 
                rel="noopener noreferrer"
                className="text-blue-600 hover:text-blue-800 text-sm flex items-center"
              >
                <ExternalLink className="mr-1 h-3 w-3" />
                🔗 Read Article
              </a>
            </div>
          ))}
        </div>
      )}

      {/* Viral Posts */}
      {sources.posts && sources.posts.length > 0 && (
        <div className="mb-4">
          <h4 className="font-medium mb-2 flex items-center">
            <TrendingUp className="mr-2 h-4 w-4" />
            💼 Viral Posts
          </h4>
          {sources.posts.map((post, index) => (
            <div key={index} className="border border-gray-200 rounded-lg p-3 mb-2 bg-gray-50">
              <div className="font-medium flex items-center">
                <TrendingUp className="mr-2 h-4 w-4" />
                💼 {post.source}
              </div>
              <div className="text-sm text-gray-600">
                👁️ {post.views} views
                {post.reactions && post.reactions !== 'Unknown' && (
                  <span className="ml-2">❤️ {post.reactions} reactions</span>
                )}
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default SourcesDisplay;
